import React from 'react';
import { Card, CardVariant } from './components/Card';
import { UserList } from './components/UserList';
import { IUser } from './types/types';

export function App() {
  const users: IUser[] = [
    { id: 1, name: 'UbiTV', email: 'asf@mai;.ru', address: { city: 'Moscow', street: 'Lenina', zipcode: '123' } },
    { id: 2, name: 'Stepan', email: 'syea@mai;.ru', address: { city: 'Krska', street: 'Molok', zipcode: '331' } },
    { id: 3, name: 'Tim', email: 'zzzd@mai;.ru', address: { city: 'Ryua', street: 'Vtrea', zipcode: '223' } },
  ]

  return (
    <div>
      <Card
        variant={CardVariant.primary}
        height='200px'
        width='200px'
      >
        <button>Кнопка</button>
      </Card>
      <UserList users={users} />
    </div >
  );
}
